import React from 'react'
import styled from 'styled-components';

const TextWrapper=styled.div``;
const PictureWrapper=styled.div``;
const DealsGrabContainer=styled.div`
text-align: center;
 //background-color: #FEDE17;
// padding-top: 40px;
// padding-bottom: 40px;
`;
const DealsWrapper=styled.div`
 padding-top: 20px;
 padding-bottom: 20px;
`;

const Connecter=styled.div`
 padding-top: 20px;
 background-color: whitesmoke;
`;

const Row=styled.div`
width: 100%;
margin: 20px auto;
background-color: transparent;
//border: 1px solid black;
`;

const Sd1=styled.div`
height: 806px;
position: relative;
background-color: whitesmoke;

&::before{
    position: absolute;
    content: '';
    width: 50%;
    height: 100%;
    top: 0;
    left: 0;
    background-color: black;
    transform: skewX(25deg);
}
`;


const Deals = () => {
    return (
        <DealsGrabContainer>
            <Connecter/>
            <DealsWrapper>
            <h1>
             Grab your Deals Now
            </h1>
            </DealsWrapper>
            <Row>
                <Sd1>

                </Sd1>
            </Row>
         {/* <div class="container">
        <div class="row">
          <div class="col">
              <TextWrapper>
                 
              </TextWrapper>
          </div>
          <div class="col">
              <PictureWrapper>
                
              </PictureWrapper>
          </div>
        </div>
      </div>  */}
      </DealsGrabContainer>
    )
}

export default Deals
